import React from 'react'
import './Search.css';
import SearchBar from './SearchBar';
import { NavLink } from 'react-router-dom';

// add a skeleton loader to the search page
import Skeleton from 'react-loading-skeleton';


function SearchPage() {
    let query = window.location.search.split('=')[1]
    const [deta, setDeta] = React.useState([])
    React.useEffect(() => {
        // get the query from the url
        let query = window.location.search.split('=')[1]
        console.log(query)
        let url = 'http://127.0.0.1:8000/search/' + query
        fetch(url).then(response =>{
            response.json().then((result) => {
                setDeta(result)
                localStorage.setItem('deta', JSON.stringify(result));
            })
        }).catch((error) => {
            console.log(error)
        })
    }, [])





  return (
    <div className='searchpage'>
        <Skeleton count={1} height={50} />
        <SearchBar/>
        <NavLink to={`/search?query=${query}`}><button type="submit" className="search__bar__button" id="search-button" style={{display: 'none'}}>
                <span className="search__bar__button__text">Search</span>
        </button></NavLink>
        <div class="container-flex">
            <div class="row">
                <div id="result" class="section col-xs-12 col-sm-11 col-lg-7">

                    {deta.map((currElem) => {
                        const {title, link, favicon, yt_url, text, cite} = currElem;

                        return (
                                    <div class="snippet fdb " data-loc="main" data-pos="0" data-type="web" data-ref-pos="0" id="snippets">
                                            <a href={link} class="result-header" target="_self">
                                                <span class="snippet-title">
                                                    <img alt="ðŸŒ" class="favicon" src={favicon}
                                                        loading="lazy" width="16" height="16" />
                                                        {title}
                                                </span>
                                            </a>
                                            <br/>
                                            <p class="snippet-description">
                                                {text}

                                                {yt_url? <img src={yt_url} width="25%" height="100%" style={{borderRadius: '8px'}} alt="logo"/> : null}

                                            </p>
                                            <cite class="snippet-url">
                                                <span class="netloc">
                                                    <a href={link} style={{color: '#6d78a0'}}>
                                                        {cite}
                                                    </a>
                                                </span>
                                            </cite>
                                    </div>
                        )
                    })}
                </div>


                {/* side right */}

                <div id="side-right" class="section col-md-5 col-sm-12">
                    <div id="infobox" class="infobox fdb" data-loc="side" data-pos="0" data-type="infobox" data-subtype="generic" data-ref-pos="0">
                        <div class="infobox-header">
                            <div class="infobox-header-text">
                                <br/>
                                <a class="infobox-title" href="/" target="_self" style={{marginLeft: '-19px', textAlign: 'inherit', marginTop: '5px', fontSize: '15px'}}>
                                    Salman Khan
                                </a>
                                <br/>
                                <div class="infobox-description" style={{padding: '0px', textAlign: 'justify'}}>


                                </div>
                            </div>
                            <div class="infobox-thumbnail" style={{background: 'var(--code-bg)', border: '1px solid #22232A'}}>
                                <a href="" target="_self">
                                    <div class="thumb">

                                        <br/> 
                                    </div>
                                    <hr/>
                                </a>
                            </div>
                        </div>

                        <div class="body">
                            <div class="mb-6">

                            </div>
                        </div>
                        <div class="body">
                            <div class="attribution text-xs">
                                    Data from
                                <a href="" id="source">Wikipedia</a> 
                            </div>
                        </div>

                    </div>
                </div>


            </div>


        </div>
    </div>
  )
}

export default SearchPage
